class Solution(object):
    def longestOnes(self, A, K):
        """
        :type A: List[int]
        :type K: int
        :rtype: int
        """
        acc = [0 for _ in range(len(A)+1)]
        acc[0] = 0
        for i in range(1,len(A)+1):
            acc[i] = acc[i-1] + A[i-1]
        i, j = 0, 1
        res = 0
        while j < len(acc):
            while acc[j] - acc[i] + K < j - i:
                i += 1
            res = max(res, j-i)
            j += 1
        return res

